import React, { Component } from 'react';
import Header from './components/Header';
import Footer from './components/Footer';
import content from './components/content';


class App extends Component {
  render() {
    return (
      <div>
        <Header/>
        <content/>
        <Footer/>
      </div>
    );
  }
}

export default App;
